script: |
  super -f text -I q432.spq | sort > q432.out

inputs:
  - name: q432.spq
    data: |
      SELECT + 9 + + col0 - + 93 + - col2 * - - col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT IN ( + 84, + col2, 67, + + 35 + + col0 - + col0 + + ( - col1 ) * col1 );
  - name: tab0

outputs:
  - name: q432.out
    data: |
